import IChangePassword from "../../../models/IChangePassword";

const ChangePassword: IChangePassword = {
    title:"Cambia tu contraseña",
    subTitle: "Debe incluir al menos un símbolo o número y tener 8 caracteres mínimo.",
    passwordPlaceHolder: "Contraseña",
    confirPassword: "Confirmí tu contraseña",
    actionButton: "ACTUALIZAR",
    errorMessage:"Debe incluir al menos un símbolo o número y tener 8 caracteres mínimo.",
    errorMessageNotEqual: "Las contraseñas deben ser iguales.",
    successToastMessageTitle: "¡Éxito!",
    successToastMessageDescription: "Registraste correctamente una nueva contraseña.",
};

export default ChangePassword;
